
create table position (
	id INT,
	title VARCHAR(50),
	pay VARCHAR(50)
);

create table store (
	id INT,
	name VARCHAR(50),
	address VARCHAR(50),
	city VARCHAR(50),
	state VARCHAR(50)
);

create table employee (
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	email VARCHAR(50),
	address VARCHAR(50),
	phone VARCHAR(50),
	position_id INTEGER NOT NULL,
	store_id INTEGER NOT NULL,
	CONSTRAINT FK_employee_position FOREIGN KEY (position_id) REFERENCES posistion(id),
	CONSTRAINT FK_employee_store FOREIGN KEY (store_id) REFERENCES store(id) 
);



